webpackJsonp([88830704356498],{7283:function(t,e){t.exports={data:{post:{html:"<p>\nEvery so often the kindergarten sends a slip home telling us that some sickness is making the rounds. Chicken pox, measles, ringworm, flu; anything that kids can get, it's on the list.</p>\n<p>\nNow for the first time, Christopher brought the disease home along with the checklist. He's sick with stomach flu. Probably only a one-day affair, but I was supposed to meet the Telekom at our ISP this morning. Hopefully my colleague didn't mind too much the wake-up call to fill in for me.</p>",fields:{title:"Stomach Flu",date:"04 Apr 2005",url:"https://papascott.de/2005-04-04-stomach-flu/"}}},pathContext:{slug:"/2005-04-04-stomach-flu/",prev:{fields:{title:"Cat Content",date:"03 Apr 2005",slug:"/2005-04-03-cat-content/"}},next:{fields:{title:"Berlin for Children",date:"05 Apr 2005",slug:"/2005-04-05-berlin-for-children/"}}}}}});
